      out.write("    var mrefreshinterval = 500 // update display every 500ms\r\n");
      out.write("    var lastmousex       = -1\r\n");
      out.write("    var lastmousey       = -1\r\n");
      out.write("    var lastmousetime\r\n");
      out.write("    var mousetravel      = 0\r\n");
      out.write("    var mpoints          = []\r\n");
      out.write("    var mpoints_max      = 30\r\n");
      out.write("    $('html').mousemove(function (e) {\r\n");
      out.write("      var mousex = e.pageX\r\n");
      out.write("      var mousey = e.pageY\r\n");
      out.write("      if (lastmousex > -1) {\r\n");
      out.write("        mousetravel += Math.max(Math.abs(mousex - lastmousex), Math.abs(mousey - lastmousey))\r\n");
      out.write("      }\r\n");
      out.write("      lastmousex = mousex\r\n");
      out.write("      lastmousey = mousey\r\n");
      out.write("    })\r\n");
      out.write("    var mdraw = function () {\r\n");
      out.write("      var md      = new Date()\r\n");
      out.write("      var timenow = md.getTime()\r\n");
      out.write("      if (lastmousetime && lastmousetime != timenow) {\r\n");
      out.write("        var pps = Math.round(mousetravel / (timenow - lastmousetime) * 1000)\r\n");
      out.write("        mpoints.push(pps)\r\n");
      out.write("        if (mpoints.length > mpoints_max) {\r\n");
      out.write("          mpoints.splice(0, 1)\r\n");
      out.write("        }\r\n");
      out.write("        mousetravel = 0\r\n");
      out.write("        $('#mousespeed').sparkline(mpoints, {\r\n");
      out.write("          width        : mpoints.length * 2,\r\n");
      out.write("          tooltipSuffix: ' pixels per second'\r\n");
      out.write("        })\r\n");
      out.write("      }\r\n");
      out.write("      lastmousetime = timenow\r\n");
      out.write("      setTimeout(mdraw, mrefreshinterval)\r\n");
      out.write("    }\r\n");
      out.write("    // We could use setInterval instead, but I prefer to do it this way\r\n");
      out.write("    setTimeout(mdraw, mrefreshinterval);\r\n");
